message:
Если вы думаете, что у вас сложная работа, посмотрите на гонщиков «Формулы-1»: 

• За 1 заезд они худеют на 3 кг из-за потери жидкости;
• Средний пульс пилота во время гонки — 170 ударов в минуту;
• Во время аварий могут выдерживать перегрузку до 55 g;
• Если бы не форма автомобиля, они бы взлетали в воздух.

Об этом мы узнали с канала «One Racing». Ребята бодро пишут о Формуле-1, гонках и всём, что с ними связано. 

Если вам надоела ерунда в ленте Инсты и Ютуба, обязательно подпишитесь: @one_racing
